import React, {useState, useEffect} from 'react';
import {useSelector} from 'react-redux';
import {getAllCart} from '../../../redux/cartRedux';
import PropTypes from 'prop-types';
import styles from './Cart.module.scss';
import {Link} from 'react-router-dom';
import {MdKeyboardArrowRight} from 'react-icons/md/index';

const Cart = () => {
  const getProductFromCart = useSelector(getAllCart);
  const [cartProducts, setCartProducts] = useState([]);

  useEffect(()=> {
    setCartProducts(getProductFromCart);
  },[]);
  console.log(cartProducts);
  return (
    <div className={styles.root}>
      <div className={styles.navigation}>
        <p>
          <Link to='/'>
            Home
          </Link>
          <MdKeyboardArrowRight />
          Shoping Cart
        </p>
      </div>
      <div className={styles.container}>
        <h1>Shopping Cart</h1>
        <div className={styles.productsContainer}>
          <table>
            <thead>
              <tr>
                <td>image</td>
                <td>product name</td>
                <td>model</td>
                <td>quantity</td>
                <td>special discount</td>
                <td>total</td>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>image</td>
                <td>product name</td>
                <td>model</td>
                <td>quantity</td>
                <td>special discount</td>
                <td>total</td>
              </tr>
            </tbody>
          </table>
        </div>
        <div className={styles.summarizing}>

        </div>
      </div>
    </div>
  );
};

Cart.propTypes = {

};

export default Cart;
